  `created_at` datetime default NULL,
  `updated_at` datetime default NULL,
  `status` int(11) default '0',
  `login` varchar(255) default NULL,
  `crypted_password` varchar(255) default NULL,
  `salt` varchar(255) default NULL,
  `last_login_at` datetime default NULL,
  `last_login_ip` varchar(255) default NULL,
  `deposit_amount` decimal(8,2) default NULL,
  `check_amount` decimal(8,2) default NULL,
  `check_type` int(11) default NULL,
  `check_date` int(11) default NULL,
  `brand_id` int(11) default NULL,
  `flag` tinyint(1) default NULL,
  PRIMARY KEY  (`id`),
  KEY `index_agencies_on_id_and_brand_id` (`id`,`brand_id`),
  KEY `agencies_login` (`login`),
  KEY `agencies_name_code` (`name`,`code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

