DROP TABLE IF EXISTS `agency_products`;
CREATE TABLE `agency_products` (
  `id` int(11) NOT NULL auto_increment,
  `agency_id` int(11) default NULL,
  `product_id` int(11) default NULL,
  `category_id` int(11) default NULL,
  `price` decimal(8,2) default '0.00',
  `created_at` datetime default NULL,
  `updated_at` datetime default NULL,
  `status` int(11) default '0',
  `purchase_price` decimal(8,2) default '0.00',
  `stock` int(11) default NULL,
  PRIMARY KEY  (`id`),
  KEY `agency_products_agency_product` (`agency_id`,`product_id`),
  KEY `index_agency_products_on_id_and_category_id` (`id`,`category_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

