DROP TABLE IF EXISTS `landmarks`;
CREATE TABLE `landmarks` (
  `id` int(11) NOT NULL auto_increment,
  `name` varchar(255) default NULL,
  `code` varchar(255) default NULL,
  `address` varchar(255) default NULL,
  `desc` text,
  `district_id` int(11) default NULL,
  `area_id` int(11) default NULL,
  `created_at` datetime default NULL,
  `updated_at` datetime default NULL,
  `img_file_name` varchar(255) default NULL,
  `img_content_type` varchar(255) default NULL,
  `img_file_size` int(11) default NULL,
  `img_updated_at` datetime default NULL,
  `status` int(11) default NULL,
  `update_products_count_at` datetime default NULL,
  PRIMARY KEY  (`id`),
  KEY `index_landmarks_on_id` (`id`),
  KEY `landmarks_query` (`name`,`address`,`status`),
  KEY `index_landmarks_on_district_id_and_area_id` (`district_id`,`area_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

