DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
  `id` int(11) NOT NULL auto_increment,
  `code` varchar(255) default NULL,
  `ex_code` varchar(255) default NULL,
  `user_id` int(11) default NULL,
  `order_items_count` int(11) default NULL,
  `price_total` decimal(8,2) default '0.00',
  `price_real` decimal(8,2) default '0.00',
  `state` varchar(255) default NULL,
  `order_type` int(11) default NULL,
  `landmark_id` int(11) default NULL,
  `agency_id` int(11) default NULL,
  `desc` text,
  `paid_at` datetime default NULL,
  `created_at` datetime default NULL,
  `updated_at` datetime default NULL,
  `ex_password` varchar(255) default NULL,
  `settlement_id` int(11) default NULL,
  `exchanged_at` datetime default NULL,
  `purchase_price_total` decimal(8,2) default '0.00',
  `bargains_id` int(11) default NULL,
  `cnee_address` varchar(255) default NULL,
  `cnee_phone` varchar(255) default NULL,
  `cnee_name` varchar(255) default NULL,
  PRIMARY KEY  (`id`),
  KEY `index_orders_on_id_and_user_id` (`id`,`user_id`),
  KEY `index_orders_on_agency_id` (`agency_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

