INSERT INTO `products` VALUES (1,'乐事薯片桶装（120g）','10020003',2,'一开就有乐事，办公室零食的首选，不同的味道拥有无限的美味','9.50',NULL,'2010-07-29 10:18:11','2010-09-02 11:08:10','乐事薯片(桶装)0005.jpg','image/jpeg',54602,'2010-07-29 10:18:10',1),(2,'腰果（110g）','10020018',2,'吃到你狂吃还想再吃','11.00',NULL,'2010-07-29 10:19:02','2010-07-30 06:06:32','腰果0028.jpg','image/jpeg',60810,'2010-07-29 10:19:02',1),(3,'鲜烤鱿鱼（65g）','10020019',2,'鱿鱼补充脑力、缓解疲劳、恢复视力、改善肝脏功能等作用','8.50',NULL,'2010-07-29 10:21:16','2010-07-30 08:03:27','鲜烤鱿鱼0029.jpg','image/jpeg',7737,'2010-07-29 10:21:16',1),(4,'吊炉花生（308g）','10020020',2,'香脆花生口味，蒜蓉的可口，成就了吊炉花生','8.50',NULL,'2010-07-29 10:21:53','2010-07-30 06:07:16','吊炉花生0030.jpg','image/jpeg',45798,'2010-07-29 10:21:53',1),(5,'雀巢威化（24+8）*20g','10070003',7,'味道确实与众不同','30.00',NULL,'2010-07-29 10:22:41','2010-08-04 10:58:03','雀巢威化0031.jpg','image/jpeg',54740,'2010-07-29 10:23:26',1),(6,'雀巢咖啡（42+6条装）','10030057',3,'味道确实与众不同','42.00',NULL,'2010-07-29 10:25:07','2010-09-17 09:54:51','雀巢咖啡0032.jpg','image/jpeg',12795,'2010-07-29 10:25:07',1),(7,'麦斯威尔咖啡（12条，156g）','10030058',3,'滴滴香浓，意犹未尽','20.00',NULL,'2010-07-29 10:25:51','2010-09-17 09:55:53','麦斯威尔咖啡0033.jpg','image/jpeg',65166,'2010-07-29 10:25:51',1),(8,'牛肉干（80g）','10020021',2,'蒙古牛肉干牛肉是中国人的第二大肉类食品，仅次于猪肉，牛肉蛋白质含量高，而脂肪含量低，所以味道鲜美， 受人喜爱，享有“肉中骄子”的美称','8.50',NULL,'2010-07-30 01:10:28','2010-08-03 02:03:28','牛肉干0034.jpg','image/jpeg',38851,'2010-07-30 01:10:28',1),(9,'纯果乐鲜果粒（420ml）','10010025',1,'\"纯果乐鲜果粒里面富含饱满多汁的新鲜果肉，嚼嚼鲜果粒，口口鲜果汁  \"','4.00',NULL,'2010-07-30 01:11:52','2010-07-30 03:46:14','纯果乐鲜果粒.jpg','image/jpeg',44543,'2010-07-30 01:11:52',1),(10,'水溶C（450ml）','10010041',1,'五个半柠檬C，满足每日所需维生素C','5.00',NULL,'2010-07-30 01:15:31','2010-07-30 05:58:59','水溶C0056.jpg','image/jpeg',10915,'2010-07-30 01:15:31',1),(11,'悦活U格（350ml）','10010042',1,'在国外国家，乳酸菌果汁饮料非常流行，是男女老少都钟爱的人气饮品，爱美又注重身体健康的年轻白领一族更是为之疯狂，U格正好填补了国内的空缺，让我们也疯狂吧，拥有芒果和柠檬的味道哦','4.00',NULL,'2010-07-30 01:16:47','2010-09-06 16:43:57','芒果U格','application/octet-stream',11997,'2010-07-30 01:16:47',1),(12,'九龙斋酸梅汤(40