DROP TABLE IF EXISTS `queued_sms`;
CREATE TABLE `queued_sms` (
  `id` int(11) NOT NULL auto_increment,
  `to` varchar(255) default NULL,
  `content` varchar(255) default NULL,
  `send_times` int(11) default '0',
  `user_id` int(11) default NULL,
  `order_id` int(11) default NULL,
  `sender` varchar(255) default NULL,
  `receiver` varchar(255) default NULL,
  `message` varchar(255) default NULL,
  `result` int(11) default '-4',
  `res_code` varchar(255) default NULL,
  `res_message` varchar(255) default NULL,
  `last_send_at` datetime default NULL,
  `created_at` datetime default NULL,
  `updated_at` datetime default NULL,
  `original_res` text,
  `mms_title` varchar(255) default NULL,
  `mms_content` varchar(255) default NULL,
  `system` tinyint(1) default '0',
  PRIMARY KEY  (`id`),
  KEY `index_queued_sms_on_id_and_order_id` (`id`,`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

