INSERT INTO `topics` VALUES (3,1,'今天游戏真爽，一晚上的战斗，收获5瓶王老吉。哈哈！让鹅毛来的更猛烈些吧……',1,0,'wlj.jpg','image/pjpeg',9499,'2010-07-29 10:02:32','2010-07-29 10:02:33','2010-08-18 09:41:11'),(5,3,'这个夏天热的实在让人抓狂，都不敢相信，在外出差的小歪给我送了个冰激淋。偶在美美地享用，谢啦～～～。何时回京呀？小歪',1,0,'bjl.jpg','image/pjpeg',9884,'2010-07-29 10:14:12','2010-07-29 10:14:12','2010-08-18 09:41:03'),(6,4,'上班第一天，正愁不知道上哪吃饭？突然，老公给我来了个短信。真不敢相信，他居然在我们写字楼下面给我定了个我喜欢吃的快餐。老公，I love you!\r\n',1,0,'kc.jpg','image/pjpeg',8467,'2010-07-29 10:15:32','2010-07-29 10:15:32','2010-08-18 09:41:20'),(7,19,'今天收到了 一瓶雀巢诱惑水，谢谢阿雄啊。',1,0,NULL,NULL,NULL,NULL,'2010-07-30 04:05:08','2010-07-30 04:09:44'),(8,64,'刚刚经朋友介绍注册了鹅毛，居然就得到一份统一绿茶，虽然还没有去领取，不过心里无比滴开心！~',1,0,NULL,NULL,NULL,NULL,'2010-08-09 11:43:44','2010-08-09 11:51:50'),(9,78,'刚收到一瓶统一酸梅汤，谢谢',1,0,NULL,NULL,NULL,NULL,'2010-08-09 13:00:56','2010-08-09 13:09:31'),(10,138,'oo',1,0,NULL,NULL,NULL,NULL,'2010-08-09 13:52:16','2010-08-09 14:38:41'),(11,124,'收到了一瓶统一绿茶，非常感谢！',1,0,NULL,NULL,NULL,NULL,'2010-08-09 14:21:18','2010-08-09 14:26:05'),(12,137,'刚收到一瓶统一酸梅汤（500ml)',1,0,NULL,NULL,NULL,NULL,'2010-08-09 14:23:03','2010-08-09 14:25:47'),(13,158,'柚子茶 500 ',1,0,NULL,NULL,NULL,NULL,'2010-08-09 14:47:42','2010-08-09 15:02:26'),(14,156,'我收到可乐一瓶！',1,0,NULL,NULL,NULL,NULL,'2010-08-09 14:58:51','2010-08-09 15:02:44'),(15,156,'收到一瓶可乐！',1,0,NULL,NULL,NULL,NULL,'2010-08-09 14:59:39','2010-08-09 15:02:56'),(16,156,'收到可乐一瓶！',1,0,'狗狗1.jpg','image/pjpeg',24967,'2010-08-09 15:01:03','2010-08-09 15:01:03','2010-08-18 09:41:26'),(17,69,'我今天收到两瓶 ，太好了，谢谢鹅毛。忠实的羽毛',1,0,NULL,NULL,NULL,NULL,'2010-08-09 15:25:12','2010-08-18 09:41:32'),(20,5,'早上和同学吵架了，心里很难过但是还不想去道歉，无聊至极网友给发了一个链接，原来是鹅毛送礼的，给她送一个吧，接着她打来电话，“对不起，我早上有点火气大了”一个鹅毛让我们比以前更亲密。顶',1,0,'paomozhixia.jpg','image/jpeg',84387,'2010-08-10 16:27:23','2010-08-10 16:27:23','2010-08-18 09:41:39'),(21,219,'远在外地，老爸过生日了但是还回不去，通过鹅毛让老爸惊喜了一次，希望这样新型的网站可以越来越好，让远在天涯的人都可以尽孝',1,0,'xinru.jpg','image/jpeg',414557,'2010-08-10 16:33:03','2010-08-10 16:33:03','2010-08-18 09:41:45'),(22,222,'一定要来谢谢鹅毛了，那天出门忘记带钱包了，然后去的那个地方也不知道在哪里，大夏天的北京热的人都要虚脱了但是还没钱买水，给朋友打电话，几乎都要窒息了，两分钟后看见鹅毛的短信说去便利店免费取水，真是感谢苍天，感谢大地，感谢鹅毛啊，回来抱着朋友亲了又亲啊',1,0,'zhaowei.jpg','image/jpeg',84134,'2010-08-10 16:43:05','2010-08-10 16:43:05','2010-08-31 17:46:08'),(23,223,'有了孩子就不能随便出去了，老公在家还可以做饭，这几天老公出差了，自己都不知道天天吃什么，老公晚上来电说明天给我送饭来，怎么可能呢，隔天真有给送外卖的，真是不可思议，这可是千里之外的老公给送的啊',1,0,'haizi.jpg','image/jpeg',21096,'2010-08-10 17:00:38','2010-08-10 17:00:38','2010-08-18 09:42:06'),(24,225,'追了两年的她，终于在暑期答应了，眼看着她的生日就要来临但是我却对她的生日礼物束手无策--隔得太远了，正在郁闷之际，妹妹提醒了一句“看看鹅毛有合适的吗”，真是雪中送炭啊，经过这个生日她对我印象是更好了',1,0,'zhiwu.jpg','image/jpeg',32637,'2010-08-10 17:05:37','2010-08-10 17:05:37','2010-08-20 09:42:40'),(25,226,'和朋友分割天涯，想送礼物还不能给一个惊喜，忽然发现了鹅毛365，真是简单，遥远的路途给省了，朋友还可以选择自己喜欢的东西，关系更近了一步，鹅毛真是太有才了！赞一个',1,0,'zhiwu1.gif','image/gif',89929,'2010-08-10 17:08:17','2010-08-10 17:08:18','2010-08-24 16:31:05'),(26,236,'哇塞，还有这样的新奇玩意呢，刚注册鹅毛给我送了一个，看看有朋友在不在鹅毛的兑换点，也给他们送去，哈哈哈哈',1,1,'狗.jpg','image/jpeg',97421,'2010-08-11 16:05:21','2010-08-11 16:05:25','2010-08-11 16:06:46'),(27,219,'真是太好了，昨天刚注册的，今天收到鹅毛的短信，说被抽中了幸运注册用户，给账户冲了10元钱，听说还有大礼呢，赶快来说说，或许明天我就中大礼了呢，是去上岛吃套餐呢，哈哈哈哈',1,0,'06.bmp','image/bmp',270054,'2010-08-11 16:13:09','2010-08-11 16:13:09','2010-08-24 16:30:43'),(28,252,'这个很新型，但是很难操作，要不是别人指导还真不知道怎么操作呢，不过很好，',1,0,NULL,NULL,NULL,NULL,'2010-08-13 10:35:21','2010-08-20 09:22:03'),(29,26,'同事送了一个大瓶装的橙汁，嘿嘿，放冰霜里，慢慢享受！！',1,1,'11.gif','image/gif',5334,'2010-08-13 14:37:32','2010-08-13 14:37:32','2010-08-16 10:22:37'),(30,261,'今天中国情人节唉，送个务实点的礼物吧，鹅毛方便还快捷，晚上在好好请他吃吧',1,0,'01.jpg','image/jpeg',19725,'2010-08-16 10:22:01','2010-08-16 10:22:01','2010-08-24 16:36:45'),(31,263,'看看鹅毛，顺便给朋友送了一杯鲜果汁，爽，希望下一个有人送给我，嘻嘻嘻嘻',1,1,NULL,NULL,NULL,NULL,'2010-08-16 14:02:14','2010-08-16 14:02:34'),(32,264,'现在真是什么都有了，开学之后一定给北京大学的同学送一些礼物，也好让他们给我也送，真是爽哇',1,1,'1.gif','image/gif',80989,'2010-08-17 09:04:31','2010-08-17 09:04:31','2010-09-03 15:27:18'),(33,266,'你们行动快点，我还等着送我好多朋友呢，最好以后在给我点积分什么的，这样我就可以少用点钱了',1,0,'1.jpg','image/jpeg',46960,'2010-08-17 10:10:21','2010-08-17 10:10:21','2010-08-31 17:46:46'),(34,266,'哈哈哈哈，以后我要是出国，也不用来回的运费了多麻烦，照样可以孝顺自己的父母了，真是棒，顶一个',1,0,NULL,NULL,NULL,NULL,'2010-08-17 13:03:08','2010-08-24 16:30:54'),(35,268,'不知道我朋友收到那个惊喜啊，都不知道用什么语言形容了，马上给我打电话说自己领了，我的上帝，还让我再给送呢说给同事看看，最好不要了',1,0,'1.jpg','image/jpeg',56039,'2010-08-18 09:40:26','2010-08-18 09:40:26','2010-08-31 17:46:35'),(36,270,'嘻嘻嘻，昨天收到老公送的巧克力，真是好高兴啊，晚上回家给他做了很多好吃的，哈哈哈哈',1,0,NULL,NULL,NULL,NULL,'2010-08-20 09:21:35','2010-08-24 16:36:38'),(37,266,'刚刚收到同学在山东送的礼物，呵呵呵呵。真是谢谢他，希望他可以看见了，谢谢你，大民',1,1,'1.jpg','image/jpeg',6719,'2010-08-24 16:30:16','2010-08-24 16:30:17','2010-08-24 16:30:31'),(38,274,'就想来看看，顺便看好什么想吃的然后让他们给我送，哈哈哈',1,1,'1.jpg','image/jpeg',5326,'2010-08-24 16:37:41','2010-08-24 16:37:41','2010-08-24 16:37:52'),(39,279,'东西都是很小的一些东西，没什么大点的，让我以前的同学看都让我选好了再给他们说，真是很贴心的，',1,1,'2.jpg','image/jpeg',35500,'2010-08-24 16:40:55','2010-08-24 16:40:55','2010-08-24 16:41:11'),(40,282,'东西刚刚拿到，去拿的时候老板还给我说要多多送礼呢，唉，看着好有意思',1,0,'1.jpg','image/jpeg',83099,'2010-08-26 10:43:32','2010-08-26 10:43:32','2010-09-03 15:28:06'),(41,283,'呵呵哈哈，收到很开心，祝鹅毛365越来越好，也希望做一些活动，让我们更便宜点的买东西啊',1,1,NULL,NULL,NULL,NULL,'2010-08-27 10:03:40','2010-08-27 10:04:06'),(42,284,'开心玩到底！',1,0,'001101929.jpg','image/pjpeg',179726,'2010-08-27 18:47:01','2010-08-27 18:47:02','2010-08-31 17:46:56'),(43,286,'美丽的荷兰',1,0,'IMG_5888.jpg','image/pjpeg',3367037,'2010-08-30 11:25:04','2010-08-30 11:25:06','2010-08-30 11:35:35'),(44,20,'这样的问候，我只能惊讶。爱你，一生一世... ... Thanks, 鹅毛365',1,1,'21.jpg','image/jpeg',76504,'2010-08-31 17:16:14','2010-08-31 17:16:14','2010-09-03 18:28:37'),(45,20,'什么时候的饭最香，肚子饿的时候；什么时候的情更浓，知道我饿的时候。好香的上岛套餐...',1,1,'55.gif','image/gif',28262,'2010-08-31 17:23:48','2010-08-31 17:23:48','2010-09-03 18:28:49'),(46,27,'千里之外，真情表白，给TA个意外\r\n手到情来，天涯之外，来就来个实在！\r\n',1,1,'周.jpg','image/jpeg',48994,'2010-08-31 17:38:29','2010-08-31 17:38:30','2010-09-03 18:28:20'),(47,288,'我给我朋友说了，让他们下午给我送的，然后我累的时候出去溜达了一圈就拿回来了，现在我们办公室好多人都玩呢，呵呵呵呵，有什么优惠记的一定告诉我们啊',1,0,'u=3542931853,998483920&fm=3&gp=0.jpg','image/jpeg',6951,'2010-08-31 17:41:38','2010-08-31 17:4